import * as axios from "axios";


const instance = axios.create({
    withCredentials: true,
    baseURL: "https://developers.ria.com/auto/",
    headers: {
      "api_key": "udjpgRF2gjAOp6ov2xYgOEcXLwXxpeFuN5JuUbjs",
    },
  });

  export const allTypesApi  =()=> {
      return instance
        .get(`https://developers.ria.com/auto/categories?api_key=udjpgRF2gjAOp6ov2xYgOEcXLwXxpeFuN5JuUbjs`)
        .then((response) => {
          return console.log (response);
        });
    }
